import React from 'react';
import './App.css';
import Sidebar from './Sidebar';
import Home from './Home';
import About from './About';

function App() {
  return (
    <div id="colorlib-page">
  		<div className="container-wrap">
      <Sidebar></Sidebar>
        <div id="colorlib-main">
          <Home></Home>
        </div>
      </div>
    </div>
  );
}

export default App;
